package project.jun.was.result.resource;public class HoResource {	private String resource;	private String code;	public HoResource(String code) {		this.code = code;	}		public HoResource(String code, String resource) {		this.code     = code;		this.resource = resource;	}	public String getCode() {		return code;	}	public void setCode(String code) {		this.code = code;	}	public String getResource() {		return resource;	}	public void setResource(String resource) {		this.resource = resource;	}	}